import React from "react";
import { Route, Switch } from "react-router";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Home from "./Home";





const App1 = () => {


    return (
        <>
            <Switch>
                <Route path="/" />
                <Home />
            
            </Switch>


        </>
    );
};
export default App1;
